// ==UserScript==
// @name        NexusMods Extended View
// @namespace   https://github.com/Official-Husko/violentmonkey-scripts
// @match       https://www.nexusmods.com/*
// @description This extends the content you can see by using more of the screen.
// @grant       none
// @license     GNU GPLv3
// @version     1.0
// @author      Official Husko
// @icon        data:image/png;base64,
// @description Never again have this empty space on the side of the page!
// @downloadURL https://update.greasyfork.org/scripts/482293/NexusMods%20Extended%20View.user.js
// @updateURL https://update.greasyfork.org/scripts/482293/NexusMods%20Extended%20View.meta.js
// ==/UserScript==
(function() {
    'use strict';

    // Find the .p-body-inner element
    const pBodyInner = document.querySelector('.wrapper');

    if (pBodyInner) {
        // Get the device width (browser window width)
        const deviceWidth = window.innerWidth;

        // Calculate 95% of the device width
        const newWidth = deviceWidth * 0.95;

        // Modify the max-width property to 95% of the device width
        pBodyInner.style.maxWidth = newWidth + 'px';
    }
})();